import { MDBBtn, MDBIcon, MDBInput, MDBInputGroup } from "mdbreact";
import React from "react";

interface ICustomerSearchProps {}

export const CustomerSearch: React.FC = () => {
  return (
    <>
      <MDBInputGroup>
        <MDBInput label="Search Customer Email"></MDBInput>
        <MDBBtn tag="a" gradient="blue">
          <MDBIcon icon="fas fa-search" />
        </MDBBtn>
      </MDBInputGroup>
    </>
  );
};
